import React, { Fragment } from "react";

const Footer = () => {
  return (
    <Fragment>
     
      <section className="sFooter">
        <div className="footer">
          <footer className="footer1">
            <a href="1">Para tu negocio</a>
            <a href="1">Conviertete en instructor</a>
            <a href="1">Aplicaciones Móviles</a>
            <a href="1">Soporte</a>
            <a href="1">Temas</a>
          </footer>

          <footer className="footer2">
            <a href="1">¿Quienes Somos?</a>
            <a href="1">Empleo</a>
            <a href="1">Blog</a>
          </footer>
        </div>
      </section>
    </Fragment>
  );
};

export default Footer;
